import logo from './logo.svg';
import './App.css';

const router = createBrowserRouter([
  {
    path: "/",
    element: <div>Hello World</div>,
  },
  {
    path: "/blog",
    element: <div>Bienvenue sur le blog</div>,
  },
  {
    path: "/contact",
    element: <div>Bienvenue sur la page contact</div>,
  },
]);

function App() {
  return <RouterProvider router={router}/>
}

export default App;
